import React from "react";
import "./home.css";

import HeaderHome from "./headerHome/HeaderHome";

function HasNoCollection(props) {
  return (
    <div className="HasNoCollection">
      <div className="content">
        <div className="title">
          {props.data.length > 0 ? "Collections" : "You have no collections."}
        </div>

        <div className="collections">
          {props.data &&
            props.data.length > 0 &&
            props.data.map((collection) => {
              console.log(collection.cId);
              return;
            })}
          <button className="addCollection button btn--flex px-5 btn--border btn--hover-bg-gray">
            <ion-icon name="add-outline"></ion-icon>
            {props.data.length > 0
              ? "Add Collections"
              : "Add Your First Collection"}
          </button>
        </div>
      </div>
    </div>
  );
}

export default function Home() {
  let collections = [
    { cId: 1, cName: "abc", cColor: "red" },
    { cId: 2, cName: "abc", cColor: "red" },
    { cId: 3, cName: "abc", cColor: "red" },
    { cId: 4, cName: "abc", cColor: "red" },
    { cId: 5, cName: "abc", cColor: "red" },
    { cId: 6, cName: "abc", cColor: "red" },
  ];
  return (
    <div className="Home">
      <HeaderHome />
      <div className="content">
        <HasNoCollection data={collections} />
      </div>
    </div>
  );
}
